import React from 'react'
import { withStyles } from "@material-ui/styles";

const styles = {
  root: {
    background: "grey",
    border: "1px solid yellow",
    padding: "16px",
  },
  avatarContainer:{
    width:"40px",
    height:"40px",
    borderRadius:"50%",
    background:"white"
  }
}

function TeamMember(props) {
  const { classes } = props;
  return (
    <div className={classes.root}>
      <div className={classes.avatarContainer}>img</div>
      <div>
        <p>Name</p>
        <p>Title</p>
      </div>
    </div>
  )
}

export default withStyles(styles)(TeamMember);
